  const getData = async () => {
    const response = await axios.get('https://api.weatherapi.com/v1/forecast.json?key=35360d18e86c4006a60111222212904&q=giza&days=7');
    const data = await response.data;
    console.log(data)
      setInfo(data)
  }
  useEffect(() => {
    getData()
  },[])
